import React from 'react';
import logo from "../images/logo.jpeg";

function Header() {
  return(
    <div>
      <img
        src={ logo }
        alt="Logo Wine - O maior clube de vinhos do mundo"
        width="130px"
      />
      <button>
        Clube
      </button>
    </div>

  );
}

export default Header;
